import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import Home from './pages/Home';
import LeagueTable from './pages/LeagueTable';
import Sidebar from './components/Sidebar';
import './App.css'; // You will define the grid styling here

const App: React.FC = () => {
  return (
    <Router>
      <div className="App">
        {/* Fixed Navbar */}
        <Navbar />

        {/* Main content under the fixed navbar */}
        <div className="container">
          {/* Left Sidebar with links */}
          <div className="sidebar">
            <Sidebar />
          </div>

          {/* Main content */}
          <div className="content">
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/league" element={<LeagueTable />} />
              {/* Add more routes as needed */}
            </Routes>
          </div>

          {/* League Table on the right */}
          <div className="league-table-column">
            <LeagueTable />
          </div>
        </div>
      </div>
    </Router>
  );
}

export default App;
